import React from 'react'
import Header from '../EmployeeDashboard/Header'
import TopStats from '../TopStats'

  const Data = [
    {
       id: 0,
       title: 'Pending Orders',
       value: '40',
    },
    {
      id: 1,
      title: 'Serviced',
      value: '14',
   },
   {
    id: 2,
    title: 'Completed',
    value: '8',
 },
 {
  id: 3,
  title: 'Overall Status',
  value: 'On Time',
},
{
  id: 4,
  title: 'Hottest Area',
  value: 'Downtown',
},
{
  id: 5,
  title: 'Coldest Area',
  value: 'New York',
},
{
  id: 6,
  title: 'Complaint Probability',
  value: '10%',
  
},
  ]

const AllOrders = () => {
  return (
    <>
      <Header />
      <div className="row gx-2 flex-nowrap head_stats mt-1">
      {Data.map((data) =>{
        return(
        <TopStats title={data.title} value={data.value} id={data.id}/>
      )})}
      </div>

      <div className="listing_wrap mt-3">
        <div className="row justify-content-between flex-nowrap">
          <div className="col-auto ">
              <div className="time_radio_group ">
                <div className="radio_single">
                  <input type="radio" name="time" id="radio1" defaultChecked/>
                  <label htmlFor='radio1'>8:00 AM</label>
                </div>
                <div className="radio_single">
                  <input type="radio" name="time" id="radio2"/>
                  <label htmlFor='radio2'>11:30 AM</label>
                </div>
              </div>
          </div>
          <div className="col-auto">
            <input type="date" name="" id="" />
          </div>
        </div>
      </div>
    </>
  )
}

export default AllOrders
